  `type` varchar(50) DEFAULT 'static',
  `position` int(11) DEFAULT NULL,
  `page_belong_to` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

